var map = L.map('map').setView([-34.6037,-58.3816], 12);

L.tileLayer('http://{s}.basemaps.cartocdn.com/light_all/{z}/{x}/{y}.png', {
    maxZoom: 19,
    attribution: '&copy; <a href="http://www.openstreetmap.org/copyright">OpenStreetMap</a>'
}).addTo(map);


map.locate({setView: true, maxZoom: 15});


function onLocationFound(e) {
    var radius = e.accuracy;

    L.circle(e.latlng,  {
        color: 'red',
        fillColor: 'red',
        fillOpacity: 1,
        radius: 10
    }).addTo(map);
    lat=e.latlng['lat']
    lon=e.latlng['lon']
    radio=0.01
    getBondis(lat,lon,radio,map)

}

map.on('locationfound', onLocationFound);


function getBondis(lat,lon,radio,map){

    lat=-34.654756208531126
    lon= -58.34646820091482
    radio=0.01

    url_base='https://6kqhkztw2umh633pg5yxo47h3y0toiyo.lambda-url.us-east-1.on.aws/?'
    url=url_base+'lat='+lat.toString()+'&lon='+lon.toString()

    getBondisNear(url)


}

let bondisNear


const getBondisNear = async (url) => {
    
    var myHeaders = new Headers();
    myHeaders.append("Content-Type", "application/json")
    var requestOptions = {
        method: 'GET',
        headers: myHeaders,
        redirect: 'follow'
      };
    const response = await fetch(url, requestOptions);
    const json = await response.json();
    bondisNear = json[0]
    rutaBondisNear=json[1]
    for (let k in bondisNear) {
        let bondi = bondisNear[k]
        lat=bondi['status']['position']['lat']
        lon=bondi['status']['position']['lon']
        nombre=ramales.filter(x=>x['routeId']==rutaBondisNear[k])[0]['shortName']
        L.circle([lat,lon], {
            color: 'black',
            fillColor: 'black',
            fillOpacity: 0.5,
            radius: 5
        }).addTo(map).bindTooltip(nombre);
    
    }

    
};

